import { IndexableObject } from './types'

export const isNumber = (x: any) => typeof x === 'number'

export const isFunction = (x: any) => typeof x === 'function'

export const isObject = (x: any) =>
  Object.prototype.toString.call(x) === '[object Object]'

export const toArray = (arrayLike: ArrayLike<any>) =>
  Array.prototype.slice.apply(arrayLike)

export const getDuplicateValsAsStrings = (arr: string[]): string[] => {
  const baseObj: IndexableObject = {}
  const obj = arr.reduce((acc, curr) => {
    acc[curr] = (acc[curr] || 0) + 1
    return acc
  }, baseObj)
  return Object.keys(obj).filter(val => obj[val] > 1)
}

// tslint only likes this with a regular function, not an arrow function
export function assign(
  target: IndexableObject,
  ...args: IndexableObject[]
): object {
  args.forEach(arg => {
    if (!arg) {
      return
    }
    // Skip over if undefined or null
    for (const nextKey in arg) {
      // Avoid bugs when hasOwnProperty is shadowed
      if (Object.prototype.hasOwnProperty.call(arg, nextKey)) {
        target[nextKey] = arg[nextKey]
      }
    }
  })
  return target
}

export const tweenProp = (start: number, end: number, position: number) =>
  start + (end - start) * position

import { isObject, assign } from '../utilities'
import { SpringPresets, SpringConfig, SpringOption } from './types'

// adapted from
// https://github.com/chenglou/react-motion/blob/master/src/presets.js
export const springPresets: SpringPresets = {
  noWobble: { stiffness: 200, damping: 26 },
  gentle: { stiffness: 120, damping: 14 },
  veryGentle: { stiffness: 130, damping: 17 },
  wobbly: { stiffness: 180, damping: 12 },
  stiff: { stiffness: 260, damping: 26 }
}

function argIsSpringConfig(
  arg: SpringConfig | keyof SpringPresets | undefined
): arg is SpringConfig {
  return isObject(arg)
}

export const normalizeSpring = (
  spring?: SpringConfig | keyof SpringPresets | any
) => {
  if (argIsSpringConfig(spring)) {
    return spring
  } else if (Object.keys(springPresets).indexOf(spring) > -1) {
    return springPresets[spring]
  } else {
    return {}
  }
}

export const getSpringConfig = ({
  flipperSpring,
  flippedSpring
}: { flipperSpring?: SpringOption; flippedSpring?: SpringOption } = {}) => {
  return assign(
    {},
    springPresets.noWobble,
    normalizeSpring(flipperSpring),
    normalizeSpring(flippedSpring)
  )
}

